import React from "react";
import { Navbar, Nav, Container, Row, NavDropdown } from "react-bootstrap";
import { LinkContainer } from "react-router-bootstrap";
import { useDispatch, useSelector } from 'react-redux';
import { logout } from '../actions/userActions';


function Header() {

    const userLogin = useSelector(state => state.userLogin);
    const { userInfo } = userLogin;

    const dispatch = useDispatch();

    const logoutHandler = () => {
        dispatch(logout());
    };

    return (
        <header>
            <Navbar
                expand="lg"
                className="color-nav"
                variant="dark"
                collapseOnSelect
            >
                <Container>
                    <LinkContainer to="/">
                        <Navbar.Brand><h1 className="title-navbar">NutriNation</h1></Navbar.Brand>
                    </LinkContainer>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="mr-auto">
                            <LinkContainer to="/about">
                                <Nav.Link>
                                    <i className="fas fa-dumbbell"></i> <font size='+1'>About Us</font>
                                </Nav.Link>
                            </LinkContainer>
                            <LinkContainer to="/cart">
                                <Nav.Link>
                                    <i className="fas fa-shopping-cart"></i> <font size='+1'>Cart</font>
                                </Nav.Link>
                            </LinkContainer>
                            {userInfo ? (
                                <NavDropdown title={`Hi, ${userInfo.name}!`} id="username" style={{ fontSize: '1.1rem' }}>
                                    <LinkContainer to="/profile">
                                        <NavDropdown.Item><font size='+1'><i class="fa-solid fa-user-pen"></i> Profile</font></NavDropdown.Item>
                                    </LinkContainer>

                                    <NavDropdown.Item onClick={logoutHandler}><font size='+1'><i class="fa-solid fa-right-from-bracket"></i> Log Out</font></NavDropdown.Item>

                                </NavDropdown>
                            ) : (
                                <LinkContainer to="/login">
                                    <Nav.Link>
                                        <i className="fas fa-user"></i> <font size='+1'>Login</font>
                                    </Nav.Link>
                                </LinkContainer>
                            )
                            }

                            {userInfo && userInfo.isAdmin && (
                                <NavDropdown title={<><i className="fa-solid fa-toolbox"></i> Admin</>} id="adminmenu" style={{ fontSize: '1.1rem' }}>                                    <LinkContainer to="/profile">
                                        <NavDropdown.Item><font size='+1'><i class="fa-solid fa-users"></i> Users</font></NavDropdown.Item>
                                    </LinkContainer>

                                </NavDropdown>                                
                            )}

                        </Nav>
                    </Navbar.Collapse>
                </Container>
            </Navbar>
        </header>
    );
}

export default Header;
